import React, { Component } from 'react';
import { ListGroup, ListGroupItem, Row, Col, Collapse, Button, CardBody, Card  } from 'reactstrap';


class Home extends Component{
  constructor(props) {
    super(props);
    this.toggle = this.toggle.bind(this);
    this.state = { collapse: false };
  }
  toggle() {
    this.setState(state => ({ collapse: !state.collapse }));
  }
  render(){


     return(

        <div className="container">
        <Card>
          <CardBody>
        <Row>

        <Col><h3>Course Content</h3></Col>

        <Col><Button color="primary" onClick={this.toggle} style={{ marginBottom: '1rem' }}>Expand all</Button></Col>

        <Col><h3>27 lectures</h3></Col>
        <Col><h3>01:32:56</h3></Col>
        </Row>
        <Collapse isOpen={this.state.collapse}>
          <Card>
            <CardBody>
            <ListGroup>
              <Row>
                <Col><h4>Mind and Focus</h4></Col>


                <Col><h4>8 lectures</h4></Col>
                <Col><h4>29:19</h4></Col>
              </Row>
            </ListGroup>
            <ListGroupItem>
            <a href="https://www.youtube.com/watch?v=m7OWXtbiXX8&list=PLC3y8-rFHvwgg3vaYJgHGnModB54rxOk3&index=9">The Importance of being focused</a>

            </ListGroupItem>
            </CardBody>
          </Card>
          <br />

        </Collapse>

        </CardBody><br />
        </Card>

        </div>



    );
  }
}

export default Home;
